import React from 'react';
import '../App.css'
import {Drawer,Box,CssBaseline, Button} from '@mui/material';
import NotificationsIcon from '@mui/icons-material/Notifications';
import CampaignIcon from '@mui/icons-material/Campaign';
import ChatIcon from '@mui/icons-material/Chat';
const drawerWidth = 240;

export const Sidebar=()=>{
  return (
    <div>
    <Box sx={{
          display: 'flex',
          flexDirection: 'column',
          height: '100%'
        }}>
      <CssBaseline />

      <Drawer

        sx={{

          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            backgroundColor:"#234872",

          },
        }}
        variant="permanent"
        anchor="left"
      >
       <div className='link'>
            <Button>Notification<NotificationsIcon /></Button>
            <Button>Announcements<CampaignIcon /></Button>
            <Button>Chat<ChatIcon /></Button>
            <Button>Tasks</Button>
            <Button>Files</Button>
            <Button>Calender</Button>
            <Button>Leaves</Button>
            <Button>Career</Button>
            <Button>Help</Button>
            <Button>Contact</Button>
            <Button>Organization chart</Button>
       </div>  
      </Drawer>

    </Box>
    </div>
  );
}
